  input: 'TEXT,F3A,,"Re:  Identification #:  C00375428                                                                                   In
    response to questions asked concerning identification of all individuals who contributed
    in excess of $200 in an election cycle, the following procedure was established
    and followed to comply with ''best efforts'' requirements.  The original solicitation
    included a clear request for the contributor''s full name, mailing address, occupation
    and name of employer.  The statement of Federal law regarding the collection and
    reporting of individual contributor identifictaion stated, ''Federal law requires
    us to use our best efforts to collect the name, mailing address, occupation and
    employer for each individual whose contributions aggregate in excess of $200 in
    an election cycle''.  A written request was sent to the contributor that had contributed
    in excess of $200 but had not provided the necessary information as requested
    on the original solicitation.  A pre-addressed post card requesting the missing
    information was included in a thank you letter within thirty days of receipt of
    the contribution.  Federal law requirements provided on the post card stated,
    ''Federal campaign election law requires our campaign to use our best efforts
    to collect the name of your employer and your job title (occupation).''  Upon
    receipt of returned post cards, the contributor''s data was updated. (Procedure
    used for all reporting cycles.)"'
